  true,\n\t\"url\": null,\n\t\"notes\": \"Ground Magnetic Data for west-central ColoradonnModeled
  ground magnetic data was extracted from the Pan American Center for Earth and Environmental
  Studies database at http://irpsrvgis08.utep.edu/viewers/Flex/GravityMagnetic/GravityMagnetic_CyberShare/
  on 2/29/2012. The downloaded text file was then imported into an Excel spreadsheet.
  This spreadsheet data was converted into an ESRI point shapefile in UTM Zone 13
  NAD27 projection, showing location and magnetic field strength in nano-Teslas. This
  point shapefile was then interpolated to an ESRI grid using an inverse-distance
  weighting method, using ESRI Spatial Analyst. The grid was used to create a contour
  map of magnetic field strength.nnThis dataset includes the raw spreadsheet data,
  an ESRI point shapefile showing magnetic sample locations and magnetic field strength,
  and an ESRI line shapefile showing magnetic contours.nnProjection: UTM Zone 13 NAD27nnMagnetic
  Contour Shapefile Extent:nWest  -108.698836    East  -105.283977 nNorth  41.048206
